import React from 'react';

const PlanetCard = (props) => {
    return(
        <div>
            <p>{props.name}</p>
            <p>{props.climate}</p>
            <p>{props.gravity}</p>
            <p>{props.terrain}</p>
        </div>
    );
}

export default PlanetCard;
